Fort William World Champs! Devastated doesn’t even come close to describe it for me. For the first time this season I really felt I could be there fighting for the top spots. The 5th place in Qualies and also how I felt and was riding all week definitely made me hungry and dream big for Finals. But things don’t always go as planned. A flat after the first split in my race run ended all the hopes for a good result. Absolutely heart broken riding down on my favourite track with such an amazing crowd and couldn’t show how I wanted to ride. Tears through the finish line but then seeing @loufergmtb at the hot seat finishing her race in 4th made me smile again. I am hungry for  more and very excited for the rest of the season. Congrats to all the 🌈 winners of the weekend, well deserved. Thank you everyone involved at @continental_nukeproof_racing . for all the special treats and the support as always. And thanks to @federciclismo for letting me wear the jersey. 
